description:
Located in Pacific Heights neighborhood on California Street, between Gough and Franklin, the Palm Royal Complex is one block from Lafayette Park, half a block from the Whole Food Market and Trader Joe's, and walking distance to Japan Town, and Fillmore and various MUNI. 

The rarely available bottom floor rear unit enjoys a peaceful atmosphere, with a personal patio space overlooking lush gardens. The unit has been recently updated with contemporary finishes for a modern, open living experience. The kitchen's dining bar connects to the spacious living room so that you can try out new recipes as your guest mingle! Other desirable features include: 

- Well lit with plenty of natural light and recessed lighting;
- Plentiful storage throughout the unit; 
- A deeded parking spot;
- Renovated bathroom with energy efficient fixtures;
- Stackable washer/dryer in laundry closet

Rent is $2,750/month. To move in first month rent plus 1.5x security deposit. There is also a move-in and move-out fees $125 each time by the condo management.
